import React from 'react'
import styled from 'styled-components'
import Image from 'next/image'

interface Props {
  className?: string 
}

let  Ads: React.FC<Props> = ( {className }) => {
  return (
    <div className={className}>
      <Image
        src="/ad-image.png"
        layout="fill"
      />
    </div>
  )
}


Ads = styled(Ads)`
  box-shadow: var(--shadow-sm);  

`

export default  Ads
